    'This information is mostly qualitative. It is up to you to determine the interest of a disjointed visit.' => 'Aceste informatii sunt in mare parte calitative. Determinarea interesului unei vizite se determina de la caz la caz.',
    'A visit corresponds to an internet user coming to your shop, and until the end of their session, only one visit is counted.' => 'O vizita corespunde unui utilizator de internet care ajunge in magazin, si pana la finalizarea sesiunii lor, se contorizeaza doar o singura vizita.',
    'A visitor is an unknown person who has not registered or logged into your store. A visitor can also be considered a person who has visited your shop multiple times.' => 'Un vizzitator este o persoana necunoscuta care nu s-a inregistrat sau nu este autentificata in site. Un vizitator poate fi considerat si o persoana care a vizitat magazinul de mai multe ori.',
