  'ModulesPagesnotfoundAdmin' => 
  array (
    'Pages not found' => 'Pagina nu a fost gasita',
    'Adds a tab to the Stats dashboard, showing the pages requested by your visitors that have not been found.' => 'Adauga o foaie la tabloul de control al statisticilor si afiseaza paginile cerute, dar neprimite de vizitatorii tai.',
    'The "pages not found" cache has been emptied.' => 'Depozitul paginilor negasite a fost golit.',
    'The "pages not found" cache has been deleted.' => 'Fisierele pentru "pagini negasite" din cache au fost sterse.',
    'Guide' => 'Ghid',
    '404 errors' => 'erori 404',
    'A 404 error is an HTTP error code which means that the file requested by the user cannot be found. In your case it means that one of your visitors entered a wrong URL in the address bar, or that you or another website has a dead link. When possible, the referrer is shown so you can find the page/site which contains the dead link. If not, it generally means that it is a direct access, so someone may have bookmarked a link which doesn\'t exist anymore.' => 'O eroare 404 este un cod de eroare HTTP ce indica faptul ca fisierul solicitat de catre utilizator nu poate fi gasit. In cazul tau inseamna ca unul dintre vizitatorii tai a introdus o adresa URL gresita in bara de adrese sau ca site-ul tau ori alt site au un link mort. Cand este posibil, sunt afisate datele referentului astfel incat sa poti gasi  pagina/site-ul care contine linkul mort. Daca nu este posibil, inseamna, de obicei, ca adresa a fost ceruta prin acces direct - poate cineva a salvat un link care nu mai exista.',
    'How to catch these errors?' => 'Cum se doreste captarea acestor erori?',
    'If your webhost supports .htaccess files, you can create one in the root directory of PrestaShop and insert the following line inside: "%s".' => 'Daca furnizorul tau de gazduire (webhost) suporta fisiere .htaccess, il poti crea in directorul radacina (root) al PrestaShop si poti insera in el urmatoarea linie: "%s".',
    'A user requesting a page which doesn\'t exist will be redirected to the following page: %s. This module logs access to this page.' => 'Un utilizator care cere acces la o pagina care nu exista va fi redirectionat catre urmatoarea pagina: %s. Acest modul inregistreaza accesul la aceasta pagina.',
    'You must use a .htaccess file to redirect 404 errors to the "404.php" page.' => 'Pentru a redirectiona erorile 404 la pagina "404.php" este necesar sa folosesti un fisier .htaccess.',
    'Page' => 'Pagina',
    'Referrer' => 'Referinta',
    'Counter' => 'Contor',
    'No "page not found" issue registered for now.' => 'Pana acum nu a fost inregistrata nicio problema cu "pagina negasita".',
    'Empty database' => 'Goleste baza de date',
    'Empty ALL "pages not found" notices for this period' => 'Sterge TOATE informarile despre pagini negasite pentru aceasta perioada',
    'Empty ALL "pages not found" notices' => 'Sterge TOATE informarile despre pagini negasite',
  ),
