    'Displays a banner on your shop.' => 'Afiseaza un banner in magazinul tau.',
    'Banner image' => 'Imagine banner',
    'Upload an image for your top banner. The recommended dimensions are 1110 x 214px if you are using the default theme.' => 'Incarca o imagine pentru banner-ul tau. Dimensiunile recomandate sunt 1110 x 214px daca folosesti tema initiala.',
    'Banner Link' => 'Linkul bannerului',
    'Enter the link associated to your banner. When clicking on the banner, the link opens in the same window. If no link is entered, it redirects to the homepage.' => 'Introduci un link asociat bannerului. Cand se va da clic pe banner, linkul se va deschide in aceeasi fereastra. Daca nu introduci un link, utilizatorul va fi redirectionat catre prima pagina.',
