  'AdminOrderscustomersHelp' => 
  array (
    'Leave this field blank if there\'s no change.' => 'Lasa acest camp gol daca nu exista nicio schimbare.',
    'Password should be at least %s characters long.' => 'Parola trebuie sa contina minimum %s caractere.',
    'Enable or disable customer login.' => 'Se permite sau nu autentificarea clientului.',
    'This customer will receive your ads via email.' => 'Acest client va primi comunicarile tale promotionale prin e-mail.',
    'Select all the groups that you would like to apply to this customer.' => 'Selecteaza toate grupurile in care vrei sa incluzi acest client.',
    'This group will be the user\'s default group.' => 'Acest grup va fi grupul implicit al utilizatorului.',
    'Only the discount for the selected group will be applied to this customer.' => 'Numai reducerile tinand de grupul selectat vor fi aplicate acestui client.',
    'Valid characters:' => 'Caractere permise:',
    'Prefix used for delivery slips.' => 'Prefix utilizat pentru avizul de livrare.',
    'The next delivery slip will begin with this number and then increase with each additional slip.' => 'Urmatorul aviz de livrare va incepe cu acest numar si apoi va fi incrementat cu fiecare aviz aditional.',
    'Adds an image before product name on Delivery-slip' => 'Adauga o imagine inainte de numele produsului pe avizul de livrare',
    'Format: 2011-12-31 (inclusive).' => 'Format: 2011-12-31 (inclusiv).',
    'Format: 2012-12-31 (inclusive).' => 'Format: 2012-12-31 (inclusiv).',
    'If enabled, your customers will receive an invoice for the purchase.' => 'Daca sunt activate, clientii vor primi o factura pentru achizitie.',
    'If required, show the total amount per rate of the corresponding tax.' => 'Daca se cere, arata suma totala pe fiecare rata de TVA.',
    'Adds an image in front of the product name on the invoice' => 'Adauga pe factura o imagine in fata numelui produsului',
