    'JPEG images have a small file size and standard quality. PNG images have a larger file size, a higher quality and support transparency. Note that in all cases the image files will have the .jpg extension.' => 'Imaginile JPEG au o dimensiune mai mica si o calitate standard. Imaginile PNG au o dimensiune mai mare, calitate crescuta si suporta efectul de transparenta. De remarcat ca in toate cazurile fisierele imaginilor vor avea extensia .jpg.',
    'WARNING: This feature may not be compatible with your theme, or with some of your modules. In particular, PNG mode is not compatible with the Watermark module. If you encounter any issues, turn it off by selecting "Use JPEG".' => 'ATENTE: Aceasta caracteristica poate fi incompatibila cu tema ta sau cu unele dintre module. In mod particular, modul PNG nu este compatibil cu modulul Monograma (Watermark). Daca apar probleme, dezactiveaza-l selectand "Foloseste JPEG".',
    'Ranges from 0 (worst quality, smallest file) to 100 (best quality, biggest file).' => 'Variaza de la 0 (cea mai proasta calitate, cele mai reduse fisiere) pana la 100 (cea mai buna calitate, cele mai mari fisiere).',
    'Recommended: 90.' => 'Valoare recomandata: 90.',
    'PNG compression is lossless: unlike JPG, you do not lose image quality with a high compression ratio. However, photographs will compress very badly.' => 'Compresia PNG nu are pierderi: spre deosebire de JPG, nu pierdeti din calitatea imaginii la valori mari ale comprimarii. Insa fotografiile nu pot fi comprimate bine in acest format.',
    'Ranges from 0 (biggest file) to 9 (smallest file, slowest decompression).' => 'Poate fi de la 0 (cel mai mare fisier) la 9 (cel mai mic fisier, cea mai lenta procesare).',
    'Recommended: 7.' => 'Valoare recomandata: 7.',
    'The maximum file size of pictures that customers can upload to customize a product (in bytes).' => 'Dimensiunea maxima a imaginilor pe care clientii le pot incarca pentru a personaliza un produs (in biti).',
    'Width of product customization pictures that customers can upload (in pixels).' => 'Latimea imaginilor de personalizare a produselor ce pot fi incarcate de clienti (in pixeli).',
    'Height of product customization pictures that customers can upload (in pixels).' => 'Inaltimea imaginilor de personalizare a produselor ce pot fi incarcate de clienti (in pixeli).',
    'This will generate an additional file for each image (thus doubling your total amount of images). Resolution of these images will be twice higher.' => 'Acest lucru va genera un fisier suplimentar pentru fiecare imagine (dubland astfel numarul total de imagini). Rezolutia acestor imagini va fi de doua ori mai mare.',
    'Enable to optimize the display of your images on high pixel density screens.' => 'Permite optimizarea afisarii imaginilor tale pe ecrane cu densitate inalta de pixeli.',
    'This should be set to yes unless you successfully moved images in "Images" page under the "Preferences" menu.' => 'Aceasta setare ar trebui sa fie "Da" doar daca nu ai mutat cu succes imaginile din pagina "Imagini" din meniul "Preferinte".',
    'Letters, underscores and hyphens only (e.g. "small_custom", "cart_medium", "large", "thickbox_extra-large").' => 'Numai litere, linii joase (underscore) si cratime (de ex. "small_custom", "cart_medium", "large", "thickbox_extra-large").',
    'Maximum image width in pixels.' => 'Latimea maxima aimaginii in pixeli.',
    'Maximum image height in pixels.' => 'Inaltimea maxima a imaginii in pixeli.',
    'This type will be used for Product images.' => 'Acest tip va fi folosit pentru imaginile produselor.',
    'This type will be used for Category images.' => 'Acest tip de imagine va fi folosit pentru categorii.',
    'This type will be used for Brand images.' => 'Acest tip va fi utilizat pentru imaginile marcii.',
    'This type will be used for Supplier images.' => 'Acest model va fi folosit pentru imaginile din sectiunea  Furnizor.',
    'This type will be used for Store images.' => 'Acest model va fi folosit pentru imaginile din sectiunea Magazin.',
    'Will appear on main page. Recommended size for the default theme: height %height% and width %width%.' => 'Va apare pe pagina principala. Dimensiunea recomandata pentru tema implicita: inaltimea %height% si latimea %width%.',
    'Will appear on email headers. If undefined, the header logo will be used.' => 'Apare in antetul e-mail-urilor. Daca nu este definit, va fi folosita sigla antet.',
    'Warning: if no invoice logo is available, the main logo will be used instead.' => 'Atentie: daca nu este specificata o sigla pentru factura, va fi folosit cea principala.',
    'Will appear on invoice headers.' => 'Va aparea in antetul facturilor.',
    'Warning: you can use a PNG file for transparency, but it can take up to 1 second per page for processing. Please consider using JPG instead.' => 'Atentie: poti utiliza un fisier PNG pentru transparenta, insa procesarea paginii poate dura pana la o secunda pentru fiecare imagine. Te rugam sa iei in considerare utilizarea in schimb a formatului JPG.',
    'Will appear in the address bar of your web browser.' => 'Apare in bara de adresa a browserului',
    'You must select a shop from the above list if you wish to choose a theme.' => 'Trebuie sa selectezi un magazin din lista de mai sus daca doresti sa selectezi o tema',
    'Browse your computer files and select the Zip file for your new theme.' => 'Navigheaza prin fisierele computerului si selecteaza fisierul Zip pentru noua tema.',
    'Indicate the complete URL to an online Zip file that contains your new theme. For instance, "http://example.com/files/theme.zip".' => 'Indica adresa URL completa a unui fisier Zip care contine noua ta tema. De exemplu, "http://examplu.ro/fisiere/tema.zip".',
    'This selector lists the Zip files that you uploaded in the \'/themes\' folder.' => 'Acest selector listeaza fisierele Zip pe care le-ai incarcat in dosarul \'/teme\'.',
    'To add "tags" click in the field, write something, and then press "Enter."' => 'Pentru a adauga "etichete" in camp, scrie ceva si apoi apasa "Enter"',
    'Regenerates thumbnails for all existing images' => 'Regenereaza miniaturile pentru toate imaginile existente',
    'Please be patient. This can take several minutes.' => 'Te rugam sa ai rabdare. Aceasta actiune poate dura mai multe minute.',
    'Be careful! Manually uploaded thumbnails will be erased and replaced by automatically generated thumbnails.' => 'Atentie! Miniaturile incarcate manual vor fi sterse si inlocuite cu cele generate automat.',
    'Select "No" only if your server timed out and you need to resume the regeneration.' => 'Alege "Nu" doar daca serverul nu a raspuns in timp util si trebuie sa continui regenerarea.',
    'Please select a module' => 'Te rugam sa alegi un modul',
    'Select a module above before choosing from available hooks' => 'Alege un modul de mai sus, inainte de a alege dintre carligele disponibile',
    'Please specify the files for which you do not want the module to be displayed.' => 'Specifica fisierele pentru care nu doresti sa fie afisat modulul',
    'Please input each filename, separated by a comma (",").' => 'Introdu toate numele de fisiere, separate prin virgule (",").',
    'You can also click the filename in the list below, and even make a multiple selection by keeping the Ctrl key pressed while clicking, or choose a whole range of filename by keeping the Shift key pressed while clicking.' => 'De asemenea, poti clica pe numele fisierului din lista de mai jos, poti chiar face o selectie multipla prin mentinerea apasata a tastei Ctrl in timp ce clichezi sau poti alege o intreaga gama de nume de fisiere prin mentinerea apasata a tastei Shift in timp ce clichezi.',
  ),
