  'ModulesSekeywordsAdmin' => 
  array (
    'Search engine keywords' => 'Cuvinte cheie pentru motoare de cautare',
    'Displays which keywords have led visitors to your website.' => 'Afiseaza cuvintele cheie care au condus vizitatorii catre site-ul tau',
    'Identify external search engine keywords' => 'Identifica cuvinte cheie externe ale motorului de cautare',
    'This is one of the most common ways of finding a website through a search engine.' => 'Aceasta este una dintre cele mai comune modalitati de a gasi un site web prin intermediul unui motor de cautare.',
    'Identifying the most popular keywords entered by your new visitors allows you to see the products you should put in front if you want to achieve better visibility in search engines.' => 'Identificarea celor mai populare cuvinte cheie introduse de noii vizitatorii iti permite sa vezi produsele ce ar trebui sa puse in fata, daca doresti sa obtii o mai buna vizibilitate in motoarele de cautare.',
    'How does it work?' => 'Cum functioneaza?',
    'When a visitor comes to your website, the web server notes the URL of the site he/she comes from. This module then parses the URL, and if it finds a reference to a known search engine, it finds the keywords in it.' => 'Atunci cand un vizitator intra pe website-ul tau, serverul web noteaza URL-ul site-ului de unde a venit el/ea. Acest modul analizeaza apoi URL-ul, si daca gaseste o trimitere la un motor de cautare cunoscut, gaseste cuvintele cheie in el.',
    'This module can recognize all the search engines listed in PrestaShop\'s Stats/Search Engine page -- and you can add more!' => 'Acest modul poate recunoaste toate motoarele de cautare mentionate in statisticile PrestaShop/ pagina motorului de cautare  - si poti adauga mai mult!',
    'IMPORTANT NOTE: in September 2013, Google chose to encrypt its searches queries using SSL. This means all the referer-based tools in the World (including this one) cannot identify Google keywords anymore.' => 'NOTA IMPORTANTA: in septembrie 2013, Google a ales sa cripteze interogarile de cautare ce folosesc SSL. Acest lucru inseamna ca toate instrumentele cu baza de referinta in lume (inclusiv acesta) nu mai pot identifica cuvinte cheie Google.',
