  'AdminShopparametersNotification' => 
  array (
    'Before you can use this tool, you need to:' => 'Inainte sa poti folosi acest instrument, trebuie sa:',
    '1) Create a blank .htaccess file in your root directory.' => '1) Creeaza un fisier .htaccess gol in directorul radacina al site-ului.',
    '2) Give it write permissions (CHMOD 666 on Unix system).' => '2) Ii dai permisiuni de scriere (CHMOD 666 pe un sistem Unix).',
    'Your robots.txt file MUST be in your website\'s root directory and nowhere else (e.g. http://www.example.com/robots.txt).' => 'Fisierul robots.txt TREBUIE sa fie in directorul radacina al site-ului si nicaieri altundeva (de ex. http://www.site.ro/robots.txt).',
    'Generate your "robots.txt" file by clicking on the following button (this will erase the old robots.txt file)' => 'Genereaza fisier "robots.txt" apasand pe urmatorul buton (aceasta va sterge vechiul fisier robots.txt)',
