    'Here you can set the URL for your shop. If you migrate your shop to a new URL, remember to change the values below.' => 'Aici poti seta URL-ul pentru magazin. Daca migrezi magazinul la un alt URL, nu uita sa schimbi valorile mai jos.',
    'The multistore option is enabled. If you want to change the URL of your shop, you must go to the "Multistore" page under the "Advanced Parameters" menu.' => 'Optiunea de magazine multiple este activata, daca doresti sa schimbi URL-ul sitului trebuie sa mergi in pagina "Magazine multiple" din meniul "Parametri avansati".',
    'This section enables you to change the default pattern of your links. In order to use this functionality, PrestaShop\'s "Friendly URL" option must be enabled, and Apache\'s URL rewriting module (mod_rewrite) must be activated on your web server.' => 'Aceasta sectiune va faciliteaza modificarea sabloanelor implicite ale linkurilor tai. Pentru a folosi aceasta functionalitate, optiunea "Adrese URL prietenoase" din PrestaShop > SEO si adrese URL trebuie sa fie activata si modulul de rescriere a adreselor URL din Apache (mod_rewrite) trebuie sa fie activat pe serverul tau de web.',
