    'Assign a valid page if you want it to be read.' => 'Atribuie o pagina valida daca vrei sa poata fi citita.',
    'You must define an SMTP server and an SMTP port. If you do not know it, use the PHP mail() function instead.' => 'Trebuie definit un server SMTP si un port SMTP. Daca nu stii cum, folosesti functia mail() a PHP.',
    'The discount value is incorrect (must be a percentage).' => 'Valoarea reducerii este incorecta (trebuie sa fie un procentaj).',
    'Wrong category ID.' => 'ID categorie gresit.',
    'The discount value is incorrect.' => 'Valoarea reducerii este incorecta.',
