    'Tax name to display in carts and on invoices (e.g. "VAT").' => 'Numele taxei care se afiseaza in cos si in factura (de ex. TVA).',
    'Format: XX.XX or XX.XXX (e.g. 19.60 or 13.925)' => 'Format: XX.XX sau XX.XXX (de ex. 19.60 sau 13.925)',
    'Zone name (e.g. Africa, West Coast, Neighboring Countries).' => 'Numele zonei (de ex. Africa, Coasta de vest, Tarile invecinate).',
    'Allow or disallow shipping to this zone.' => 'Permite sau interzice livrarea in aceasta zona.',
    'ISO code (e.g. USD for Dollars, EUR for Euros, etc.).' => 'Cod ISO (de ex. USD pentru dolar, EUR pentru euro, etc.).',
    'Exchange rates are calculated from one unit of your shop\'s default currency. For example, if the default currency is euros and your chosen currency is dollars, type "1.20" (1€ = $1.20).' => 'Ratele de schimb sunt calculate pornind de la o unitate a monedei implicite a magazinului. De exemplu, daca moneda implicita este euro si moneda aleasa este dolarul, se introduce "1.20" (1€ = $1.20).',
    'You can define a range of Zip/postal codes (e.g., 75000-75015) or simply use one Zip/postal code.' => 'Poti defini mai multe coduri postale (de ex. 75000-75015) sau poti utiliza unul singur.',
    'You must define the behavior if an address matches multiple rules:' => 'Trebuie sa definesti regulile pentru cazul in care o adresa corespunde mai multor reguli:',
    '- This tax only: Will apply only this tax' => '- Doar aceasta taxa: se va aplica doar aceasta taxa',
    '- Combine: Combine taxes (e.g.: 10% + 5% = 15%)' => '- Combinare: combina taxele (de ex. 10% + 5% = 15%)',
    '- One after another: Apply taxes one after another (e.g.: 100 + 10% => 110 + 5% = 115.5)' => '- Una dupa cealalta: Aplica taxele una dupa cealalta (de ex.: 100 + 10% => 110 + 5% = 115.5)',
    'No Tax' => 'Fara TVA',
    '(Total tax: %s)' => '(Total taxe: %s)',
    'The default language used in your shop.' => 'Limba implicita folosita in magazin.',
    'Set browser language as default language' => 'Configureaza limba din browser ca limba implicita',
    'The default country used in your shop.' => 'Tara Prestabilita folosita in magazin.',
    'Set country corresponding to browser language' => 'Configureaza tara corespunzatoare limbii din browser',
    'The default currency used in your shop.' => 'Moneda implicita folosita in magazin.',
    'If you change the default currency, you will have to manually edit every product price.' => 'Daca se schimba moneda implicita, va tebui sa editezi manual fiecare pret de produs.',
    'The default weight unit for your shop (e.g. "kg" for kilograms, "lbs" for pound-mass, etc.).' => 'Unitate implicita de greutate pentru magazinul tau (de ex. "kg" for kilograme, "lbs" for livre, etc.).',
    'The default distance unit for your shop (e.g. "km" for kilometer, "mi" for mile, etc.).' => 'Unitatea implicita de distanta pentru magazinul tau (de ex. "km" for kilometru, "mi" pentru mile, etc.).',
    'The default volume unit for your shop (e.g. "L" for liter, "gal" for gallon, etc.).' => 'Unitatea implicita de volum pentru magazinul tau (de ex. "L" for litru, "gal" for galon, etc.).',
    'The default dimension unit for your shop (e.g. "cm" for centimeter, "in" for inch, etc.).' => 'Unitatea implicita de lungime pentru magazinul tau (e.g. "cm" for centimetru, "in" pentru inci, etc.).',
    'The ISO 639-1 identifier for the language of the country where your web server is located (en, fr, sp, ru, pl, nl, etc.).' => 'Identificatorul ISO 639-1 pentru limba tarii in care este localizat serverul tau (ro, en, fr, sp, ru, pl, nl, etc.).',
    'The ISO 3166-1 alpha-2 identifier for the country/region where your web server is located, in lowercase (us, gb, fr, sp, ru, pl, nl, etc.).' => 'Identificatorul ISO 3166-1 alpha-2 pentru tara/regiunea in care este localizat serverul tau, cu minuscule (ro, us, gb, fr, sp, ru, pl, nl, etc.).',
    'If set to yes then the localization pack will be downloaded from prestashop.com. Otherwise the local xml file found in the localization folder of your PrestaShop installation will be used.' => 'Daca este setat da, atunci pachetul de localizare va fi descarcat de pe prestashop.com. In caz contrar, va fi utilizat fisierul local XML gasit in folderul localizat instalat pe PrestaShop-ul tau',
    'Restrict country selections in front office to those covered by active carriers' => 'Restrange listele de tari accesibile clientilor la cele acoperite de curierii activi',
    'Two -- or three -- letter ISO code (e.g. "us" for United States).' => 'Cod ISO din 2 sau 3 litere (de ex. "ro" pentru Romania).',
    'International call prefix, (e.g. 1 for United States).' => 'Prefix pentru apelare internationala (de ex. +40 pentru Romania).',
    'Geographical region.' => 'Zona geografica.',
    'Indicate the format of the postal code: use L for a letter, N for a number, and C for the country\'s ISO 3166-1 alpha-2 code. For example, NNNNN for the United States, France, Poland and many other; LNNNNLLL for Argentina, etc. If you do not want PrestaShop to verify the postal code for this country, leave it blank.' => 'Definiti formatul pe care trebuie sa il aiba codul postal: folosesti L pentru o litera, N pentru un numar si C pentru codul ISO 3166-1 alpha-2 al tarii. De exemplu: NNNNN pentru SUA, Franta, Polonia, Romania si multe altele, LNNNNLLL pentru Argentina, etc. Daca nu doresti ca PrestaShop sa impuna formatul codului postal pentru aceasta tara, lasa casuta goala.',
    'Display this country to your customers (the selected country will always be displayed in the Back Office).' => 'Se afiseaza aceasta tara clientilor tai (tara selectata va fi tot timpul afisata in back-office).',
    'This will restore your last registered address format.' => 'Aceasta optiune va restaura ultimul format de adresa inregistrat.',
    'This will restore the default address format for this country.' => 'Aceasta optiune va restaura formatul de adresa implicit pentru aceasta tara.',
    'This will restore your current address format.' => 'Aceasta optiune va restaura formatul de adresa curent.',
    'This will delete the current address format' => 'Aceasta optiune va sterge formatul de adresa curent',
    'Some of these expressions use this special syntax: %s.' => 'Unele dintre aceste expresii folosesc aceasta sintaxa speciala: %s.',
    'There are [1]%replace%[/1] products' => 'Exista [1]%replace%[/1] produse',
    '%s" will be replaced by a number.' => '%s va fi inlocuit de un numar.',
    'List of pages in [1]%replace%[/1]' => 'Lista de pagini in [1]%replace%[/1]',
    '%s" will be replaced by a string.' => '%s" va fi inlocuit de un sir.',
    'Feature: [1]%1%[/1] ([1]%2%[/1] values)' => 'Caracteristica: [1]%1%[/1] ([1]%2%[/1] valori)',
    'The numbers enable you to reorder the variables when necessary.' => 'Numerele iti permit sa reordonezi variabilele atunci cand este necesar.',
    'You MUST use this syntax in your translations. Here are several examples:' => 'TREBUIE sa folosesti aceasta sintaxa in traducerile tale. Aici ai cateva exemple:',
    'Click on the title of a section to open its fieldsets.' => 'Fa clic pe titlul unei sectiuni pentru a-i deschide seturile de campuri.',
    'Here you can modify translations for all installed module.' => 'Aici poti modifica traducerile pentru toate modulele instalate.',
    'Select your module' => 'Selecteaza modulul',
    'You MUST use this syntax in your translations. Here are a few examples:' => 'TREBUIE sa folosesti aceasta sintaxa in traducerile tale. Aici ai cateva exemple:',
    'This expression uses a special syntax:' => 'Aceasta expresie utilizeaza o sintaxa speciala:',
    'Here you can modify translations for every line of text inside PrestaShop.' => 'Aici poti modifica traducerile pentru toate campurile de text din Prestashop.',
    'First, select a type of translation (such as "Back office" or "Installed modules"), and then select the language you want to translate strings in.' => 'Mai intai, selecteaza un tip de traducere (cum ar fi "Back office" sau "Module instalate"), apoi selecteaza limba in care doresti sa traduci sirurile.',
    'You can add or update a language directly from the PrestaShop website here.' => 'Poti adaaga sau actualiza o limba direct din prestashop.com aici.',
    'If the language file format is ISO_code.gzip (e.g. "us.gzip"), and the language corresponding to this package does not exist, it will automatically be created.' => 'Daca formatul numelui este: codiso.gzip (de ex. ro.gzip) si limba corespunzatoare acestui pachet nu exista, va fi creata in mod automat.',
    'Warning: This will replace all of the existing data inside the destination language.' => 'Atentie: aceasta va inlocui toate datele existente in limba de destinatie.',
    'Export data from one language to a file (language pack).' => 'Exporta date dintr-o limba intr-un fisier (pachet lingvistic).',
    'Select which theme you would like to export your translations to.' => 'Alege tema pentru care doresti sa exporti traducerile.',
    'Copies data from one language to another.' => 'Copiaza datele dintr-o limba in alta.',
    'If necessary [1][2] you must first create a new language[/1].' => 'Ar putea fi nevoie [1][2] sa creezi intai o limba noua[/1].',
    'Missing files are marked in red' => 'Fisierele lipsa sunt marcate cu rosu',
