    'If you set these parameters to 0, they will be disabled.' => 'Daca setezi acesti parametri la 0, vor fi dezactiveaza',
    'Coupons are not taken into account when calculating free shipping.' => 'Cupoanele de reducere nu sunt luate in considerare la calculul transportului gratuit.',
    'Your shop\'s default carrier' => 'Curierul implicit al magazinului tau',
    'This will only be visible in the front office.' => 'Aceasta va fi vizibil doar in Front Office.',
    'Your online store needs to have a proper carrier registered in PrestaShop as soon as you start shipping your products. This means sending yours parcels using your local postal service, or having a contract with a private carrier which in turn will ship your parcels to your customers. In order to have PrestaShop suggest the most adequate carrier to your customers during their order checkout process, you need to register all the carriers with which you have chosen to work.' => 'Magazinul tau online trebuie sa aiba un operator de transport adecvat, inregistrat in PrestaShop, imediat ce incepi sa iti livrezi produsele. Aceasta inseamna trimiterea coletelor tale utilizand serviciul postal local, sau posedarea unui contract cu un operator de transport privat, care, la randul sau, va livra coletele clientilor tai. Pentru ca PrestaShop sa sugereze cel mai adecvat transportator pentru clientii tai in timpul procesului de finalizare a comenzii, este necesar sa inregistrezi toti transportatorii cu care ai ales sa lucrezi.',
    'PrestaShop comes with a number of carrier modules that you can activate. You can also buy carrier modules on the PrestaShop Addons marketplace. Recommended modules are listed below: install the module that matches your carrier, and configure it!' => 'PrestaShop vine cu o serie de module de transportatori pe care le poti activa. Poti cumpara, de asemenea, module cu transportatori de pe PrestaShop Addons. Modulele recomandate sunt enumerate mai jos: instaleaza modulul care se potriveste cu transportatorul tau si configureaza-l!',
    'If there is no existing module for your carrier, then you can register that carrier by hand using the information that it can provide you: shipping rates, regional zones, size and weight limits, etc. Click on the "Add new carrier" button below to open the Carrier Wizard, which will help you register a new carrier in a few steps.' => 'In cazul in care nu exista niciun modul existent pentru transportatorul tau, poti inregistra acel transportator manual, utilizand informatiile pe care acesta ti le poate oferi: tarifele de transport, zonele regionale, limita de dimensiune si greutate etc. Apasa pe butonul "Adauga un transportator nou" de mai jos pentru a porni ghidul de creare a transportatorilor, care te va ajuta sa inregistrezi un transportator nou in cativa pasi.',
    'Note: DO NOT register a new carrier if there already exists a module for it! Using a module will be much faster and more accurate!' => 'Nota: NU inregistra un transportator nou in cazul in care deja exista un modul pentru acesta! Cu ajutorul unui modul va fi mult mai rapid si mai exact!',
