    'Number of customer accounts created' => 'Numarul de conturi de client create',
    'The total number of accounts created is not in itself important information. However, it is beneficial to analyze the number created over time. This will indicate whether or not things are on the right track. You feel me?' => 'Numarul total de conturi de client create nu este el singur important. Totusi este important sa analizezi numarul peste de-a lungul timpului. Iti va arata daca lucrurile merg in directia corecta. Nu esti de acord?',
    'How to act on the registrations\' evolution?' => 'Cum sa reactionezi la evolutia inregistrarilor?',
    'If you let your shop run without changing anything, the number of customer registrations should stay stable or show a slight decline.' => 'Daca iti lasi magazinul sa mearga fara a face nici-o schimbare, numarul de clienti inregistrati va ramane stabil sau va arata o usoara scadere.',
    'A significant increase or decrease in customer registration shows that there has probably been a change to your shop. With that in mind, we suggest that you identify the cause, correct the issue and get back in the business of making money!' => 'O crestere sau scadere semnificativa in numarul inregistrarilor arata ca probabil a fost facuta o modificare in magazinul tau. Avand asta in minte, iti sugeram sa identifici cauza, sa corectezi eroarea si sa revenii in afacere pentru a face bani!',
    'Here is a summary of what may affect the creation of customer accounts:' => 'Aici ai un rezumat al lucrurilor care ar putea afecta crearea conturilor de client:',
    'An advertising campaign can attract an increased number of visitors to your online store. This will likely be followed by an increase in customer accounts and profit margins, which will depend on customer "quality." Well-targeted advertising is typically more effective than large-scale advertising... and it\'s cheaper too!' => 'O campanie publicitara poate atrage un numar mare de vizitatori catre magazinul tau online. Aceasta va fi probabil urmata de o crestere a conturilor de clienti si a profiturilor marginale, ce vor depinde de ”calitatea” clientului. Publicitatea bine-tintita are mai mult efect decat publicitatea la scala larga... si este de asemenea mai ieftina!',
    'Specials, sales, promotions and/or contests typically demand a shoppers\' attentions. Offering such things will not only keep your business lively, it will also increase traffic, build customer loyalty and genuinely change your current e-commerce philosophy.' => 'Ofertele speciale, lichidarile, promotiile si/sau concursurile necesita atentia cumparatorilor. Oferirea de astfel de lucruri nu numai ca va vor pastra afacerea in viata, dar va contribui si la cresterea traficului, a loialitatii clientilor si la schimbarea politicii comertului.',
    'Design and user-friendliness are more important than ever in the world of online sales. An ill-chosen or hard-to-follow graphical theme can keep shoppers at bay. This means that you should aspire to find the right balance between beauty and functionality for your online store.' => 'Designul si interfata prietenoasa sunt mai importante ca niciodata in lumea vanzarilor online. O tema aleasa gresit sau greu de urmarit pot indeparta cumparatorii. Asta inseamna ca ar trebui sa aspiram sa gasim balanta corecta intre frumusete si functionalitate.',
    'CSV Export' => 'Export CSV',
  ),
  'AdminShopparametersHelp' => 
  array (
    'Enable this option only if your server allows URL rewriting (recommended).' => 'Activeaza aceaasta optiune numai daca serverul tau permite rescrirea adreselor URL (optiune recomandata).',
    'URL rewriting (mod_rewrite) is not active on your server, or it is not possible to check your server configuration. If you want to use Friendly URLs, you must activate this mod.' => 'Rescrierea de URL-uri (mod_rewrite) nu este activa pe server sau nu este posibila verificarea configurariii. Daca doresti sa folosesti URL-uri prietenoase trebuie sa ai activat acest mod.',
    'Enable this option if you want to allow accented characters in your friendly URLs.' => 'Activeaza aceasta optiune daca doresti sa permiteti diacritice in adresele URL prietenoase.',
    'You should only activate this option if you are using non-latin characters ; for all the latin charsets, your SEO will be better without this option.' => 'Aceasta optiune ar trebui activata doar daca se folosesc caractere non-latine; pentru toate seturile de caractere latine SEO va fi mai buna fara aceasta optiune.',
    'Enable this option only if you have problems with URL rewriting.' => 'Activeaza aceasta optiune doar daca ai probleme cu rescrierea de URL-uri pentru unele pagini.',
    'Some of PrestaShop\'s features might not work correctly with a specific configuration of Apache\'s mod_security module. We recommend to turn it off.' => 'Unele dintre functiile din PrestaShop ar putea sa nu functioneze corect cu anumita configureazae a modulului mod_security din Apache. Iti recomandam sa il dezactivezi.',
    'You can search for a new domain name or add a domain name that you already own. You will be redirected to your PrestaShop account.' => 'Poti sa cauti un nume nou de domeniu sau sa adaugi un nume de domeniu pe care il detii deja. Vei fi redirectionat la contul tau din PrestaShop.',
    'Name of the related page.' => 'Numele paginii inrudite.',
    'Title of this page.' => 'Titlul acestei pagini.',
    'A short description of your shop.' => 'O scurta descriere a magazinului.',
    'List of keywords for search engines.' => 'Lista de cuvinte cheie pentru motoarele de cautare.',
    'To add tags, click in the field, write something, and then press the "Enter" key.' => 'Pentru a adauga o eticheta clicheaza pe casuta, scrie ceva si apasa tasta "Enter".',
    'For instance, "contacts" for http://example.com/shop/contacts to redirect to http://example.com/shop/contact-form.php' => 'De exemplu, "contact" pentru http://exemplu.ro/magazin/contact redirectioneaza catre http://exemplu.ro/magazin/contact-form.php',
    'Only letters and hyphens are allowed.' => 'Doar litere si cratime sunt permise.',
    'Invalid characters:' => 'Caractere nepermise:',
    'Image width in pixels. Enter "0" to use the original size.' => 'Latimea imaginii in pixeli. Introdu "0" pentru a se folosi dimensiunile originale.',
    'Image height in pixels. Enter "0" to use the original size.' => 'Inaltimea imaginii in pixeli. Introdu "0" pentru a se folosi dimensiunile originale.',
    'Activate or deactivate your shop (It is a good idea to deactivate your shop while you perform maintenance. Please note that the webservice will not be disabled).' => 'Activeaza sau dezactiveaza magazinul. Este o idee buna sa dezactivezi magazinul in perioadele de timp in care se lucreaza la el. Trebuie sa stii ca webservice-ul nu va fi dezactivat.',
    'IP addresses allowed to access the front office even if the shop is disabled. Please use a comma to separate them (e.g. 42.24.4.2,127.0.0.1,99.98.97.96)' => 'Adresele de IP care au acces la front office, chiar daca magazinul este dezactivat. Foloseste virgula pentru a le separa (de ex. 42.24.4.2,127.0.0.1,99.98.97.96)',
    'Custom text displayed on maintenance page while shop is deactivated.' => 'Text personalizat afisat pe pagina de intretinere in timpul in care magazinul este dezactivat.',
    'Display an overview of the addresses, shipping method and cart just before the order button (required in some European countries).' => 'Afiseaza o prezentare generala a adreselor, metodei de livrare si cosului chiar inainte de butonul de comanda (obligatoriu in unele tari europene).',
    'Allow guest visitors to place an order without registering.' => 'Permiteti vizitatorilor oaspeti sa creeze o comanda fara sa se inregistreze.',
    'Disable the option to allow customers to reorder in one click from the order history page (required in some European countries).' => 'Se dezactiveaza optiunea de a permite clientilor sa sorteze cu un clic din pagina de istoric al comenzilor (cerinta obligatorie in unele tari europene).',
    'Set to 0 to disable this feature.' => 'Seteaza la 0 pentru a dezactiva aceasta caracteristica.',
    'Automatically updates the shipping costs when you edit an order.' => 'Actualizeaza automat costurile de transport atunci cand editezi o comanda.',
    'Allow the customer to ship orders to multiple addresses. This option will convert the customer\'s cart into one or more orders.' => 'Se ofera clientilor posibilitatea livrarii comenzilor la adrese multiple. Aceasta optiune va converti cosul clientului in una sau mai multe comenzi.',
    'Allows you to delay shipping at your customers\' request.' => 'Iti permite sa intarzii livrarea la cererea clientului.',
    'Require customers to accept or decline terms of service before processing an order.' => 'Se cere clientilor acordul cu termenii serviciului inainte de procesarea comenzii.',
    'Choose the page which contains your store\'s terms and conditions of use.' => 'Alege pagina care contine termenii si conditiile de utilizare a magazinului tau.',
    'Suggest gift-wrapping to customers.' => 'Se ofera clientilor posibilitatea ambalarii de tip cadou.',
    'Set a price for gift wrapping.' => 'Seteaza un pret pentru impachetarea cadoului.',
    'Set a tax for gift wrapping.' => 'Seteaza o taxa pentru impachetarea cadoului.',
    'Suggest recycled packaging to customer.' => 'Se sugereaza impachetare in materiale reciclate clientilor.',
    'The group defined for your un-identified visitors.' => 'Grupul definit pentru vizitatorii neidentificati.',
    'The group defined for your identified guest customers (used in guest checkout).' => 'Grupul definit pentru clientii tai identificati de tip oaspete (utilizat in finalizarea comenzilor oaspetilor).',
    'The group defined for your identified registered customers.' => 'Grupul definit pentru clientii tai inregistrati.',
    'Automatically apply this value as a discount on all products for members of this customer group.' => 'Pentru membrii acestui grup de clienti, se va aplica in mod automat aceasta valoare ca o reducere pentru toate produsele.',
    'How prices are displayed in the order summary for this customer group.' => 'Cum sunt afisate preturile in sumarul comenzii pentru acest grup de clienti.',
    'Customers in this group can view prices.' => 'Clientii din acest grup pot vedea preturile.',
    '%s - All persons without a customer account or customers that are not logged in.' => '%s - Toate persoanele fara un cont de client sau clientii care nu sunt autentificati.',
    '%s - All persons who placed an order through Guest Checkout.' => '%s - Toate persoanele care au plasat o comanda prin cont de oaspete.',
    '%s - All persons who created an account on this site.' => '%s - Toate persoanele care si-au creat un cont pe acest sit.',
    'PrestaShop has three default customer groups:' => 'PrestaShop are trei grupuri prestabilite de clienti:',
    'Whether or not to display this store.' => 'Daca se afiseaza sau nu magazinul.',
    'Storefront picture.' => 'Imaginea magazinului.',
    'Displayed in emails sent to customers.' => 'Afisat in e-mailurile trimise clientilor.',
    'Shop registration information (e.g. SIRET or RCS).' => 'Date fiscale despre magazin (ex. CUI sau CIF).',
    'Order status (e.g. \'Pending\').' => 'Stadiu de comanda (de ex. \'In procesare\').',
    'Invalid characters: numbers and' => 'Caractere nepermise: numere si',
    'Upload an icon from your computer (File type: .gif, suggested size: 16x16).' => 'Incarca o pictograma de pe computerul tau (tipul fisierului: .gif, dimensiune recomandata: 16x16).',
    'Status will be highlighted in this color. HTML colors only.' => 'Stadiul va fi evidentiat cu aceasta culoare. Numai culori HTML.',
    'Only letters, numbers and underscores ("_") are allowed.' => 'Sunt permise numai litere, numere si undescore ("_").',
    'Email template for both .html and .txt.' => 'Sablon de e-mail pentru .html si .txt.',
    'Order\'s return status name.' => 'Numele stadiului de returnare a comenzii.',
    'When active, all shopping features will be disabled.' => 'Cand este activa, toate functiile legate de vanzare vor fi dezactivate.',
    'Set the maximum size of the summary of your product description (in characters).' => 'Seteaza lungimea maxima a descrierii produsului (in caractere).',
    'characters' => 'caractere',
    'How to calculate quantity discounts.' => 'Modul de calcul al reducerilor la cantitate.',
    'When active, friendly URL will be updated on every save.' => 'Daca aceasta setare este activa, adresele URL prietenoase vor fi actualizate la fiecare salvare.',
    'When active, new products will be activated by default during creation.' => 'Atunci cand este activa, produsele noi vor fi activate in mod implicit in timpul crearii.',
    'Number of products displayed per page. Default is 10.' => 'Numarul de produse afisate intr-o pagina. Implicit este 10.',
    'The order in which products are displayed in the product list.' => 'Ordinea in care sunt afisate produsele in lista de produse',
    'Default order method for product list.' => 'Metoda implicita de comandare pentru lista de produse.',
    'Set to "0" to disable this feature.' => 'Seteaza 0 pentru a dezactiva aceasta caracteristica',
    'Display or hide the "add to cart" button on category pages for products that have attributes forcing customers to see product details.' => 'Afiseaza sau ascunde butonul "Adauga in cos" pe paginile categoriilor pentru produsele care au atribute pentru a forta clientii sa vada detaliile produsului.',
    'In the volume discounts board, display the new price with the applied discount instead of showing the discount (ie. "-5%").' => 'Pe panoul reducerilor de volum se va afisa pretul nou cu reducerea aplicata in loc de a afisa reducerea (de ex. "-5%").',
    'By default, the Add to Cart button is hidden when a product is unavailable. You can choose to have it displayed in all cases.' => 'In mod implicit, butonul Adauga in cos este ascuns cand produsul este indisponibil. Poti decide sa fie afisat permanent.',
    'When selling packs of products, how do you want your stock to be calculated?' => 'Atunci cand vinzi pachete de produse, cum doresti sa fie calculat stocul?',
    'After a customer logs in, you can recall and display the content of his/her last shopping cart.' => 'Dupa ce un client se autentifica, poti afisa continutul ultimului sau cos de cumparaturi.',
    'Send an email with summary of the account information (email, password) after registration.' => 'Trimite un e-mail cu rezumatul informatiile contului (e-mail, parola) dupa inregistrare.',
    'Minimum time required between two requests for a password reset.' => 'Intervalul de timp minim permis intre doua cereri de resetare a parolei.',
    'Activate or deactivate B2B mode. When this option is enabled, B2B features will be made available.' => 'Se activeaza sau se dezactiveaza mod B2B. Cand aceasta optiune este activata devin disponibile o serie de caracteristici B2B (business to business).',
    'Display or not the birth date field.' => 'Afiseaza sau nu campul pentru data nasterii.',
    'Display or not the partner offers tick box, to receive offers from the store\'s partners.' => 'Afiseaza sau nu caseta de bifare pentru ofertele de la parteneri, pentru a primi oferte din partea partenerilor magazinului.',
    'Leave blank if no change.' => 'Lasa gol daca nu sunt modificari.',
    'Fee given for each visit.' => 'Comision acordat pentru fiecare vizita.',
    'Fee given for each order placed.' => 'Comision pentru fiecare comanda plasata.',
    'If you know how to use MySQL regular expressions, you can use the [1]expert mode[/1].' => 'Daca stii sa folosesti expresii regulate in MySQL, poti folosi [1]modul expert[/1].',
    'If you own an SSL certificate for your shop\'s domain name, you can activate SSL encryption (https://) for customer account identification and order processing.' => 'In cazul in care posezi un certificat SSL pentru numele de domeniu al magazinului, ai posibilitatea de a activa criptarea SSL (https://) pentru identificarea contului de client si procesarea comenzilor.',
    'If you want to enable SSL on all the pages of your shop, activate the "Enable on all the pages" option below.' => 'In cazul in care doresti sa activezi SSL pe toate paginile magazinului, activeaza optiunea "Activeaza pe toate paginile" de mai jos.',
    'When enabled, all the pages of your shop will be SSL-secured.' => 'Cand e activa, toate paginile magazinului vor fi securizate cu SSL.',
    'Enable or disable token in the Front Office to improve PrestaShop\'s security.' => 'Activeaza sau dezactiveaza jetonul in Front Office pentru imbunatatirea securitatii.',
    'Allow iframes on text fields like product description. We recommend that you leave this option disabled.' => 'Se permit iframe-uri in campurile de text cum este descrierea produsului. Iti recomandam sa dezactivezi aceasta optiune.',
    'Clean the HTML content on text fields. We recommend that you leave this option enabled.' => 'Curata continutul HTML din campurile de text. Iti recomandam sa activezi aceasta  optiune.',
    'You can choose among 6 different ways of rounding prices. "Round up away from zero ..." is the recommended behavior.' => 'Poti alege dintre 6 moduri diferite de rotunjire a preturilor. "Rotunjire in plus cand este la jumatate" este comportamentul recomandat.',
    'You can choose when to round prices: either on each item, each line or the total (of an invoice, for example).' => 'Poti alege cand sa rotunjesti preturile: fie pentru fiecare element, fiecare linie sau totalul (unei facturi, de exemplu).',
    'Choose how many decimals you want to display' => 'Alege cate zecimale vrei sa afiseze',
    'Enable brands and suppliers pages on your front office even when their respective modules are disabled.' => 'Permite accesul la paginile de producatori si de furnizori in front office, chiar daca modulele corespunzatoare sunt dezactivate.',
    'Enable best sellers page on your front office even when its respective module is disabled.' => 'Se permite accesul la pagina cu cele mai cumparate produse in front office, chiar daca modulul corespunzator nu este activ.',
    'The multistore feature allows you to manage several e-shops with one Back Office. If this feature is enabled, a "Multistore" page will be available in the "Advanced Parameters" menu.' => 'Facilitatea multi-magazin permite administrarea mai multor magazine intr-o singura interfata. Daca este activata aceasta caracteristica, va aparea o pagina "Magazine multiple" in "Parametri avansati".',
    'Contact name (e.g. Customer Support).' => 'Nume de contact (de ex. Asistenta pentru clienti).',
    'Emails will be sent to this address.' => 'E-mail-urile vor fi trimise la aceasta adresa.',
    'If enabled, all messages will be saved in the "Customer Service" page under the "Customer" menu.' => 'Daca este activat, toate mesajele vor fi salvate in pagina "Serviciu clienti" din meniul "Client"',
    'Further information regarding this contact.' => 'Informatii suplimentare despre acest contact.',
    'Enable the automatic indexing of products. If you enable this feature, the products will be indexed in the search automatically when they are saved. If the feature is disabled, you will have to index products manually by using the links provided in the field set.' => 'Activeaza indexarea automata a produselor. Daca activeaza aceasta caracteristica, produsele vor fi indexate pentru cautare in mod automat cand sunt salvate. Daca nu o activeaza, va trebui sa indexezi manual produsele folosind linkurile din acest bloc.',
    'By default, to search for “blouse”, you have to enter “blous”, “blo”, etc (beginning of the word) – but not “lous” (within the word).' => 'In mod implicit, pentru a cauta "bluza", trebuie sa introduci "bluz", "blu" etc. (inceputul cuvantului) - si nu "luz" (in interiorul cuvantului).',
    'With this option enabled, it also gives the good result if you search for “lous”, “ouse”, or anything contained in the word.' => 'Cu aceasta optiune activata, cautarea ofera un rezultat bun in cazul in care cauti "luz", "uza", sau orice alte litere continute in cuvant.',
    'Enable search within a whole word, rather than from its beginning only.' => 'Activeaza cautarea in interiorul unui cuvant, nu numai la inceputul acestuia.',
    'It checks if the searched term is contained in the indexed word. This may be resource-consuming.' => 'Se verifica daca termenul cautat este continut in cuvantul indexat. Aceasta poate avea un consum semnificativ de resurse.',
    'By default, if you search "book", you will have "book", "bookcase" and "bookend".' => 'In mod implicit, cand cauti ”carte”, vei gasi ”carte”, ”cartela” si "cartelare".',
    'With this option enabled, it only gives one result “book”, as exact end of the indexed word is matching.' => 'Cu aceasta optiune activa, vei avea numai un singur rezultat - "carte", deoarece se cauta sfarsitul exact al cuvantului.',
    'Enable more precise search with the end of the word.' => 'Activeaza o cautare mai precisa la sfarsitul cuvantului.',
    'It checks if the searched term is the exact end of the indexed word.' => 'Aceasta verifica daca termenul cautat este sfarsitul exact al cuvantului indexat.',
    'Only words this size or larger will be indexed.' => 'Vor fi indexate doar cuvintele care au cel putin acest numar de caractere.',
    'Please enter the index words separated by a "|".' => 'Introdu cuvintele separate prin "|".',
    'Enter each alias separated by a comma (e.g. \'prestshop,preztashop,prestasohp\').' => 'Introduci fiecare pseudonim separat cu virgula (de ex. \'prestshop,preztashop,prestasohp\').',
    'Forbidden characters: <>;=#{}' => 'Caractere nepermise: <>;=#{}',
    'Search this word instead.' => 'Se cauta acest cuvant in loc.',
    'This field does not refer to the shop name visible in the front office.' => 'Acest camp nu se refera la numele vizibil in Front Office al magazinului.',
    'Follow %sthis link%s to edit the shop name used on the front office.' => 'Urmeaza %sacest link%s pentru a edita numele folosit in Front Office al magazinului.',
    'You can\'t edit the shop group because the current shop belongs to a group with the "share" option enabled.' => 'Nu se poate edita grupul de magazine pentru ca magazinul curent apartine unui grup cu optiuni de partajare activate.',
    'This is the root category of the store that you\'ve created. To define a new root category for your store, %splease click here%s.' => 'Aceasta este categoria radacina pentru magazinul pe carel-ai creat. Pentru a defini o noua categorie radacina a magazinului tau, %ste rugam sa clichezi aici%s.',
    'By selecting associated categories, you are choosing to share the categories between shops. Once associated between shops, any alteration of this category will impact every shop.' => 'Prin selectarea categoriilor asociate, alegi sa folosesti in comun categoriile in magazine. Odata asociate intre magazine, orice modificare a unei categorii asociate va afecta toate magazinele pentru care aceste categorii sunt asociate.',
    'e.g. 10:00AM - 9:30PM' => 'de ex. 10:00 - 21:30',
    'Show me more' => 'Arata mai mult',
    'Definitions:' => 'Definitii:',
    'The "http_referer" field is the website from which your customers arrive.' => 'Campul `http_referer`este site-ul de unde vin clientii tai',
    'For example, visitors coming from Google will have an "http_referer" value like this one: "http://www.google.com/search?q=prestashop".' => 'De exemplu vizitatorii care vin din Google vor avea o valoarea \'http_referer\' ca acesta: "http://www.google.ro/search?q=prestashop".',
    'If the visitor arrives directly (by typing the URL of your shop, or by using their bookmarks, for example), the http_referer will be empty.' => 'Daca vizitatorul vine direct (prin introducerea URL-ului sau prin folosirea de bookmarks, de exemplu), http_referer va fi gol.',
    'If you\'d like to view all the visitors coming from Google, you can type "%google%" in this field. Alternatively, you can type "%google.fr%" if you want to view visitors coming from Google France, only.' => 'Deci daca vrei toti vizitatorii care au venit de la Google, poti scrie \\"%google%\\" in acest camp, sau \\"%google.ro%\\" daca vrei doar vizitatorii care vin de la Google Romania.',
    'The "request_uri" field is the URL from which the customers come to your website.' => 'Campul "request_uri" este URL-ul de unde clientii vin pe site-ul tau.',
    'For example, if the visitor accesses a product page, the URL will be like this one: "%smusic-ipods/1-ipod-nano.html".' => 'De exemplu, in cazul in care vizitatorul acceseaza o pagina de produs, URL-ul va fi ca acesta: "%smuzica-ipods/1-ipod-nano.html".',
    'This is helpful because you can add tags or tokens in the links pointing to your website.' => 'Este interesant pentru ca se pot adauga etichete sau tokenuri in linkurile care tintest spre situl tau.',
    'For example, you can post a link (such as "%sindex.php?myuniquekeyword" -- note that you added "?myuniquekeyword" at the end of the URL) in an online forum or as a blog comment, and get visitors statistics for that unique link by entering "%%myuniquekeyword" in the "request_uri" field.' => 'De exemplu, poti posta un link (cum ar fi "%sindex.php?myuniquekeyword" -- observa ca ai adaugat "?myuniquekeyword" la sfarsitul URL-ului) intr-un forum online sau ca un comentariu pe blog, si obtii statistici despre vizitatorii acelui link unic prin introducerea "%%myuniquekeyword" in campul "request_uri".',
    'This method is more reliable than the "http_referer" one, but there is one disadvantage: if a search engine references a page with your link, then it will be displayed in the search results and you will not only indicate visitors from the places where you posted the link, but also those from the search engines that picked up that link.' => 'Aceasta metoda este mai sigura decat "http_referer", insa exista un dezavantaj: in cazul in care un motor de cautare face referire la o pagina cu link-ul tau, atunci acesta va fi afisat in rezultatele cautarii si va indica nu doar vizitatorii din locurile unde ai postat linkul, dar, de asemenea, si pe cei din motoarele de cautare, care au luat acel link.',
    'The "Include" fields indicate what has to be included in the URL.' => 'Campurile "Include" indica ce trebuie sa contina URL-ul.',
    'The "Exclude" fields indicate what has to be excluded from the URL.' => 'Campurile "Exclude" indica ce trebuie sa fie exclus din URL.',
    'When using simple mode, you can use a wide variety of generic characters to replace other characters:' => 'Cand este folosit modul simplu, se pot folosi caractere generice care pot inlocui orice caracter:',
    '_" will replace one character. If you want to use the real "_", you should type this: "\\\\_".' => '_" va inlocui un caracter. Daca vrei sa folosesti "_" real, va trebui sa tastezi urmatoarele: "\\\\_".',
    '%" will replace any number of characters. If you want to use the real "%", you should type this: "\\\\%".' => '"%" va inlocui orice numar de caractere. Daca vrei sa folosesti "%" real, va trebui sa tastezi asa: "\\\\%".',
    'The Simple mode uses the MySQL "LIKE" pattern matching, but for a higher potency you can use MySQL\'s regular expressions in the Expert mode.' => 'Modul simplu foloseste potrivirea de modele "LIKE" din MySQL, insa pentru o cautare mai puternica, poti folosi si alte expresii MySQL in modul Expert.',
    'Take a look at MySQL\'s documentation for more details.' => 'Vezi documentatia MySQL pentru mai multe detalii.',
    'Get help!' => 'Solicita ajutor!',
