  'AdminAdvparametersHelp' => 
  array (
    'Warning: Enabling the "share customers" and "share orders" options is not recommended. Once activated and orders are created, you will not be able to disable these options. If you need these options, we recommend using several categories rather than several shops.' => 'Atentie: nu este recomandata activarea "Clienti comuni" si "Comenzi comune". Odata ce sunt activate si sunt create comenzi, nu vei mai putea dezactiva aceste optiuni. Daca aceste optiuni sunt necesare, iti recomandam sa folosesti categorii in loc de magazine.',
    'Once this option is enabled, the shops in this group will share customers. If a customer registers in any one of these shops, the account will automatically be available in the others shops of this group.' => 'Odata ce aceasta optiune este activata, clientii vor fi comuni tuturor magazinelor din acest grup. Cand un client se inregistreaza in oricare dintre aceste magazine, contul va fi automat disponibil in celelalte magazine din acest grup.',
    'Warning: you will not be able to disable this option once you have registered customers.' => 'Atentie: nu vei putea dezactiva aceasta optiune odata ce ai clienti inregistrati.',
    'Once this option is enabled (which is only possible if customers and available quantities are shared among shops), the customer\'s cart will be shared by all shops in this group. This way, any purchase started in one shop will be able to be completed in another shop from the same group.' => 'Dupa activarea acestei optiuni (lucru posibil doar daca stocurile si clientii sunt comuni magazinelor grupului), cosul clientului va fi comun tuturor magazinelor din acest grup. In acest fel, orice sesiune de cumparaturi inceputa in unul din magazinele din grup va putea fi finalizata in oricare din magazinele din acelasi grup.',
    'Warning: You will not be able to disable this option once you\'ve started to accept orders.' => 'Atentie: nu vei putea dezactiva aceasta optiune odata ce ai inceput sa accepti comenzi.',
    'Enable or disable this shop group?' => 'Acest grup de magazine este activ?',
    'New modules and updates are displayed on the modules page.' => 'Modulele noi si actualizarile sunt afisate in pagina modulelor.',
    'Check the IP address of the cookie in order to prevent your cookie from being stolen.' => 'Verifica adresa IP a cookie-ului pentru evitarea furtului de cookie.',
    'Set the amount of hours during which the back office cookies are valid. After that amount of time, the PrestaShop user will have to log in again.' => 'Stabilesti durata in ore a vietii cookie-urilor in paginile de administrare. Dupa acest interval de timp, utilizatorul de PrestaShop va trebui sa se autentifice din nou.',
    'Set the maximum size allowed for attachment files (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %s MB).' => 'Defineste marimea maxima a fisierelor atasate (in megabytes). Aceasta valoare trebuie sa fie egala sau mai mica decat marimea maxima permisa de serverul tau (valoarea curenta: %s MB).',
    'Define the upload limit for a downloadable product (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %s MB).' => 'Stabilesti limita de marime a unui produs descarcabil (in megaocteti sau MB). Aceasta valoare trebuie sa fie mai mica sau egala cu marimea maxima permisa de serverul tau la incarcarea unui fisier (limita curenta: %s MB).',
    'Define the upload limit for an image (in megabytes). This value has to be lower or equal to the maximum file upload allotted by your server (currently: %s MB).' => 'Definiti limita de marime pentru imaginile incarcate (in megaocteti, MB). Aceasta valoare trebuie sa fie mai mica sau egala cu maximul permis de serverul tau (limita curenta: %s MB).',
    'Notifications are numbered bubbles displayed at the very top of your back office, right next to the shop\'s name. They display the number of new items since you last clicked on them.' => 'Notificarile sunt bule numerotate, afisate in partea de sus a paginii de administrare a magazinului, chiar langa numele magazinului. Acestea arata cate articole noi au aparut de cand ai clicat ultima data pe bule.',
    'This will display notifications when new orders are made in your shop.' => 'Aceasta optiune va afisa notificari pentru comenzile noi primite de magazinul tau.',
    'This will display notifications every time a new customer registers in your shop.' => 'Aceasta optiune va afisa notificari de fiecare data cand un client nou se inregistreaza in magazinul tau.',
    'This will display notifications when new messages are posted in your shop.' => 'Aceasta optiune va afisa notificari atunci cand sunt postate mesaje noi in magazinul tau.',
    'Drop existing tables during import.' => 'Renunta la tabelele curente in timpul importului.',
    'If enabled, the backup script will drop your tables prior to restoring data.' => 'Daca este activata optiunea, scriptul pentru copia de siguranta va renunta la tabelele tale inainte de a restaura datele.',
    '(ie. "DROP TABLE IF EXISTS")' => '(de ex. "DROP TABLE IF EXISTS")',
    'Where customers send messages from the order page.' => 'Unde clientii trimit mesaje din pagina de comanda.',
    'Fully qualified domain name (keep this field empty if you don\'t know).' => 'Nume domeniu calificat complet (se lasa gol daca nu se cunoaste).',
    'IP address or server name (e.g. smtp.mydomain.com).' => 'Adresa IP sau nume server (de ex. smtp.domeniu.ro).',
    'Leave blank if not applicable.' => 'Se lasa gol daca nu este aplicabil.',
    'Use an encrypt protocol' => 'Utilizeaza un protocol de criptare',
    'If you want to add a virtual URL, you need to activate URL rewriting on your web server and enable Friendly URL option.' => 'In cazul in care doresti adaugarea unei adrese URL virtuala, trebuie activata rescrierea adreselor URL pe server si trebuie activata optiunea Adrese URL prietenoase.',
    'You can use this option if you want to create a store with a URL that doesn\'t exist on your server (e.g. if you want your store to be available with the URL www.example.com/my-store/shoes/, you have to set shoes/ in this field, assuming that my-store/ is your Physical URL).' => 'Poti folosi aceasta optiune daca doresti sa creezi un magazin cu un URL care nu exista pe serverul tau (de ex. daca doresti ca magazinul sa fie disponibil cu URL-ul www.magazinul-meu.ro/magazin/pantofi/, pune pantofi/ in acest camp, daca magazin/ este URL-ul fizic).',
    'URL rewriting must be activated on your server to use this feature.' => 'Pentru a folosi aceasta facilitate, rescrierea adreselor URL trebuie sa fie activata pe server.',
    'If you set this URL as the Main URL for the selected shop, all URLs set to this shop will be redirected to this URL (you can only have one Main URL per shop).' => 'Daca setezi acest URL ca URL principal pentru magazinul selectat, toate URL-urile setate pentru acest magazin vor fi redirectionate catre acest URL (poti avea doar un singur URL principal pentru un magazin).',
    'Since the selected shop has no main URL, you have to set this URL as the Main URL.' => 'Pentru ca magazinul selectat nu are un URL principal, trebuie sa-l setezi pe acesta ca URL principal',
    'The selected shop already has a Main URL. Therefore, if you set this one as the Main URL, the older Main URL will be set as a regular URL.' => 'Magazinul selectat are deja o adresa URL principala. Prin urmare, daca o setezi pe aceasta ca principala, cea veche va fi deveni secundara.',
    'This is the physical folder for your store on the web server. Leave this field empty if your store is installed on the root path. For instance, if your store is available at www.example.com/my-store/, you must input my-store/ in this field.' => 'Folderul fizic al magazinului pe serverul web. Lasa campul gol daca magazinul este instalat in radacina. De exemplu, daca magazinul este disponibil la www.magazin.ro/magazin/, se introduce magazin/ in acest camp.',
    'Warning: URL rewriting (e.g. mod_rewrite for Apache) seems to be disabled. If your Virtual URL doesn\'t work, please check with your hosting provider on how to activate URL rewriting.' => 'Atentie: Rescrierea URL-ului (de ex. mod_rewrite pentru Apache) pare sa fie dezactivata. Daca URL-ul tau virtual nu functioneaza, verifica cu gazda site-ului tau pentru cai de activare a rescrierii de URL-uri.',
    'This option should be used in a production environment.' => 'Aceasta optiune ar trebui folosita in productie.',
    'Templates are recompiled when they are updated. If you experience compilation troubles when you update your template files, you should use Force Compile instead of this option. It should never be used in a production environment.' => 'Sabloanele sunt recompilate cand sunt actualizate, daca sunt probleme cu compilarea cand sunt modificate fisierele sablon, ar trebui folosita optiunea Forteaza compilarea in locul acesteia. Nu ar trebui folosita in productie.',
    'This forces Smarty to (re)compile templates on every invocation. This is handy for development and debugging. Note: This should never be used in a production environment.' => 'Aceasta optiunea forteaza Smarty sa recompileze sabloanele la fiecare invocare. Este utila pentru dezvoltare si debug. Nu ar trebui folosita in productie.',
    'Should be enabled if you want to avoid to store the smarty cache on NFS.' => 'Ar trebui sa fie activate daca doresti sa eviti stocarea de cache Smarty pe NFS.',
    'Enable or disable debug mode.' => 'Activeaza sau dezactiveaza modul de depanare.',
    'Some features can be disabled in order to improve performance.' => 'Unele caracteristici pot fi dezactivate pentru a imbunatati performanta.',
    'Choose "No" to disable Product Combinations.' => 'Alege "Nu" pentru a dezactiva combinatiile produselor.',
    'You cannot set this parameter to No when combinations are already used by some of your products' => 'Nu poti alege valoarea Nu pentru acest parametru atat timp cat exista combinatii in uzul produselor tale',
    'Choose "No" to disable Product Features.' => 'Alege "Nu" pentru a dezactiva caracteristicile produselor.',
    'Choose "No" to disable Customer Groups.' => 'Alege "Nu" pentru a dezactiva grupurile de clienti.',
    'CCC allows you to reduce the loading time of your page. With these settings you will gain performance without even touching the code of your theme. Make sure, however, that your theme is compatible with PrestaShop 1.4+. Otherwise, CCC will cause problems.' => 'CCC iti permite sa reduci timpul de incarcare al paginii. Cu aceste setari vei castiga performanta fara a atinge codul temei. Asigurate, totusi, ca tema folosita este compatibila cu PrestaShop 1.4+, altfel CCC va crea probleme.',
    'This will add directives to your .htaccess file, which should improve caching and compression.' => 'Aceasta va adauga directive in fisierul .htaccess care ar trebui sa imbunatateasca folosirea de cache si compresia.',
    'Name of the second domain of your shop, (e.g. myshop-media-server-1.com). If you do not have another domain, leave this field blank.' => 'Numele celui de al doilea domeniu al magazinului, (de ex. magazinul-meu-media-server-1.ro). Daca nu ai un alt domeniu, lasa campul gol.',
    'Name of the third domain of your shop, (e.g. myshop-media-server-2.com). If you do not have another domain, leave this field blank.' => 'Numele celui de al doilea domeniu al magazinului, (de ex. magazinul-meu-media-server-2.ro). Daca nu ai un alt domeniu, lasa campul gol.',
    'Name of the fourth domain of your shop, (e.g. myshop-media-server-3.com). If you do not have another domain, leave this field blank.' => 'Numele celui de al doilea domeniu al magazinului, (de ex. magazinul-meu-media-server-3.ro). Daca nu ai un alt domeniu, lasa campul gol.',
    'Enter "5" if you do not want to receive any emails.' => 'Introdu "5" daca nu vrei sa primesti niciun e-mail.',
    'Emails will be sent to the shop owner.' => 'Mesajele vor fi trimise proprietarului magazinului.',
    'Your avatar in PrestaShop 1.7.x is your profile picture on %url%. To change your avatar, log in to PrestaShop.com with your email %email% and follow the on-screen instructions.' => 'Avatarul tau in PrestaShop 1.7.x este imaginea din profilul tau de la %url%. Pentru a iti schimba avatarul, autentifica-te pe PrestaShop.com cu adresa ta de e-mail %e-mail% si urmeaza instructiunile de pe ecran.',
    'Password should be at least %num% characters long.' => 'Parola trebuie sa fie lunga de cel putin %num% caractere.',
    'PrestaShop can provide you with guidance on a regular basis by sending you tips on how to optimize the management of your store which will help you grow your business. If you do not wish to receive these tips, you can disable this option.' => 'PrestaShop te poate ghida in mod regulat, trimitandu-ti sfaturi pentru optimizarea administrarii magazinului tau, ceea ce te va ajuta sa iti dezvolti afacerea. Daca nu doresti sa primesti aceste sfaturi, poti dezactiva aceasta optiune.',
    'This page will be displayed just after login.' => 'Acesta pagina va fi afisata doar dupa autentificare.',
    'Allow or disallow this employee to log in to the Admin panel.' => 'Permite sau interzice acestui angajat sa se autentifice in panoul de administrare.',
    '-- Choose --' => '-- Alege --',
    'Select the shops the employee is allowed to access.' => 'Selecteaza magazinele accesibile angajatilor.',
    'Before activating the webservice, you must be sure to: ' => 'Inainte de a activa webservice, trebuie sa te asiguri ca: ',
    'Check that URL rewriting is available on this server.' => 'Verifica daca rescrierea adreselor URL este disponibila pe acest server.',
    'Check that the five methods GET, POST, PUT, DELETE and HEAD are supported by this server.' => 'Asigura-te ca cele 5 metode GET, POST, PUT, DELETE si HEAD sunt suportate de server.',
    'Before choosing "Yes", check that PHP is not configured as an Apache module on your server.' => 'Inainte de a alege "Da", verifica daca PHP nu este configurat pe server ca modul Apache.',
    'Quick description of the key: who it is for, what permissions it has, etc.' => 'Scurta descriere a cheii: pentru ce este, ce permisiuni are, etc.',
    'Use this option to associate data (products, modules, etc.) the same way for each selected shop.' => 'Foloseste aceasta optiune pentru a asocia date (produse, module, etc) in acelasi fel pentru fiecare magazin selectat.',
    'Click here to display the shops in the %s shop group' => 'Da clic aici pentru a afisa magazinele din grupul %s',
    'Click here to display the URLs of the %s shop' => 'Da clic aici pentru a afisa adresele URL ale magazinului %s',
    'Click here to display the list of shop groups' => 'Da clic aici pentru a afisa lista grupurilor de magazine',
    'How do I create a new SQL query?' => 'Cum creez o noua interogare SQL?',
    'Click "Add New".' => 'Clicheaza pe "Adauga".',
    'Fill in the fields and click "Save".' => 'Completeaza campurile si clicheaza pe "Salveaza".',
    'You can then view the query results by clicking on the Edit action in the dropdown menu' => 'Poti vedea apoi rezultatul interogarii dand clic pe Edit in meniul dropdown',
    'You can also export the query results as a CSV file by clicking on the Export button' => 'Poti de asemenea exporta rezultatul interogarii ca fisier CSV dand clic pe butonul Export',
    'Ignore this field if you don\'t use the Multistore tool. If you leave this field empty, the default shop will be used.' => 'Ignora acest camp daca nu folosesti unealta de magazine multiple. Daca se lasa gol acest camp, se va folosi magazinul implicit.',
    'Enable Advanced Stock Management on product (0 = No, 1 = Yes)' => 'Permiteti gestiunea avansata a stocurilor de produs (0=Nu, 1=Da)',
    '0 = Use quantity set in product, 1 = Use quantity from warehouse.' => '0 = Foloseste cantitatea stabilita pe pagina produsului, 1 = Foloseste cantitatea din depozit.',
    'ID of the warehouse to set as storage.' => 'Identificatorul (ID) depozitului de setat ca spatiu de depozitare.',
    'A category root is where a category tree can begin. This is used with multistore.' => 'O categorie radacina este locul de unde poate incepe un arbore de categorii. Aceasta categorie este folosita pentru magazine multiple.',
    'Enable Advanced Stock Management on product (0 = No, 1 = Yes).' => 'Permiteti gestiunea avansata a stocurilor de produs (0 = Nu, 1 = Da).',
    'or' => 'sau',
    'How to restore a database backup in 10 easy steps' => 'Cum se restaureaza in 10 pasi usori o copie de siguranta a unei baze de date',
    'Set "Enable Shop" to "No" in the "Maintenance" page under the "Preferences" menu.' => 'Seteaza "Activare magazin" pe "Nu" din pagina de "Mentenanta" din meniul de "Preferinte".',
    'Download the backup from the list below or from your FTP server (in the folder "admin/backups").' => 'Descarca copia de siguranta din lista de mai jos sau via FTP (in dosarul "admin/backups").',
    'Check the backup integrity: Look for errors, incomplete file, etc... Be sure to verify all of your data.' => 'Verifica integritatea copiei de siguranta: cauta existenta erorilor, a fisierelor incomplete, etc. Fii sigur ca ai verificat toate datele.',
    'Please ask your hosting provider for "phpMyAdmin" access to your database.' => 'Cere furnizorului tau de gazduire acces "phpMyAdmin" pentru la baza ta de date.',
    'Connect to "phpMyAdmin" and select your current database.' => 'Conecteaza-te la "phpMyAdmin" si selecteaza baza ta de date curenta.',
    'Unless you enabled the "Drop existing tables" option, you must delete all tables from your current database.' => 'Doar daca nu ai activat optiunea "Drop existing tables (Renunta la tabelele curente)", trebuie sa stergi toate tabelele din baza ta de date curenta.',
    'At the top of the screen, please select the "Import" tab' => 'Din partea de sus a ecranului se selecteaza tabul "Import"',
    'Click on the "Browse" button and select the backup file from your hard drive.' => 'Da clic pe butonul "Rasfoieste (Browse)" si selecteaza copia de siguranta din unitatea ta.',
    'If your backup file exceeds this limit, contact your hosting provider for assistance. ' => 'Daca fisierul tau de backup depaseste aceasta limita, contacteaza furnizorul de gazduire web pentru asistenta. ',
    'Click on the "Go" button and please wait patiently for the import process to conclude. This may take several minutes.' => 'Apasa pe butonul "Go" si asteapta ca procesul de import sa se finalize. Acesta poate dura cateva minute.',
    'PrestaShop is not responsible for your database, its backups and/or recovery.' => 'PrestaShop nu este responsabil pentru baza ta de date, copiile ei de siguranta si/sau recuperarea acestor copii.',
    'How to restore a database backup in 10 easy steps:' => 'Cum sa restaurezi o copie de siguranta in 10 pasi simpli:',
    'You can read information on import at:' => 'Poti citi informatii despre import la:',
    'http://doc.prestashop.com/display/PS17/Import' => 'http://doc.prestashop.com/display/PS17/Import',
    'http://en.wikipedia.org/wiki/Comma-separated_values' => 'http://en.wikipedia.org/wiki/Comma-separated_values',
    'Allowed formats: .csv, .xls, .xlsx, .xlst, .ods, .ots' => 'Formate permise: .csv, .xls, .xlsx, .xlst, .ods, .ots',
    'Only UTF-8 and ISO 8859-1 encodings are allowed' => 'Sunt permise doar codificarile UTF-8 si ISO-8859-1',
    'You can also upload your file via FTP to the following directory: %s .' => 'Fisierul se poate incarca si via FTP in urmatorul director: %s.',
    'e.g. ' => 'de ex. ',
    'If enabled, the product\'s reference number MUST be unique!' => 'Daca este activa, codul de referinta al produsului TREBUIE sa fie unic!',
    'If you enable this option, your imported items\' ID number will be used as-is. If you do not enable this option, the imported ID numbers will be ignored, and PrestaShop will instead create auto-incremented ID numbers for all the imported items.' => 'Daca activezi aceasta optiune, ID-urile articolelor importate vor fi folosite ca atare. Daca nu activezi aceasta optiune, ID-urile importate vor fi ignorate, iar PrestaShop va crea in loc ID-uri auto-incrementate pentru toate articolele importate.',
    'Sends an email to let you know your import is complete. It can be useful when handling large files, as the import may take some time.' => 'Trimite un e-mail pentru a te anunta ca importarea este finalizata. Acesta poate fi util atunci cand manipulezi fisiere mari, deoarece importul poate dura mult.',
